Agar sizda quyidagi xabar bo'lsa tijorat reklama, Internet-resurslarni reklama qilish;
 xabarlar, unda sizdan SMS yuborish so'raladi qisqa raqam yoki boshqa pochta xabarlari, maqsad bu aldashdan iborat Sizning pulingiz;
 sizni o'z ichiga olgan xatlar shaxsiy ma'lumotlaringizni taqdim etish so'raladi, parollar va boshqalar, faqat anketa qo'shing yuboruvchini e'tiborsiz qoldiring, shuningdek ushbu anketada "shikoyat qilish" tugmasini bosing va sababini tanlang shikoyatlar. Shundan so'ng, anketa tushadi moderatorlar uchun majburiy tekshirish ilovalar.
 Biz faqat talab qila olmaymiz foydalanuvchilar "yaxshi bo'ling" va yo'q bezorilik bilan shug'ullaning. Virtualda dunyo, xuddi oflayn rejimda bo'lgani kabi, jinoyatchilar ham bor, hamma uchun o'rnatilganlarni buzish qoidalar.
 Hamma qilishi kerak bo'lgan asosiy narsa foydalanuvchilar hushyor bo'lishlari kerak va provokatsiyalarga berilmang. Keyin bu erda firibgarlar uchun hech narsa bo'lmaydi qilish.
